    // </div>

    <div id='top' className={`${themeName} app`}>

      <Header />
{/* 
      <main>
        <About />
        <Projects />
        <Skills />
        <Contact />
      </main> */}

      <Routes>
         <Route path="/" element={<About />} />
         <Route path="about" element={<About />} />
      </Routes>

      <ScrollToTop />
      <Footer />


    </div>

  )
}

export default App

// App.js
function HomeT() {
  return (
    <>
      <main>
        <h2>Welcome to the homepage!</h2>
        <p>You can do this, I believe in you.</p>
      </main>
      <nav>
        <Link to="/about">About</Link>
      </nav>
    </>
  );
}

function AboutT() {
  return (
    <>
      <main>
        <h2>Who are we?</h2>
